After reviewing the transactions, we note that only the “Initial” transactions contribute to the paid‐in capital. In this case there are three items on 2023‑12‑31:

• “Cash deposit”: 3,000,000.00  
• “Bank deposit”: 5,000,000.00  
• “Fixed Assets”: 5,000,000.00  

Adding these amounts gives an initial paid‐in capital of 3,000,000 + 5,000,000 + 5,000,000 = 13,000,000.00. Since no additional paid‐in transactions occur later in the data, the paid-in capital at the end of the period remains the same.

Thus, the solution is:

